import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';
import Modal from 'react-modal';
import '../styles/VillaDetail.css';

Modal.setAppElement('#root');

const VillaDetail = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [villa, setVilla] = useState(null);
  const [spaces, setSpaces] = useState([]);
  const [selectedSpace, setSelectedSpace] = useState(null);
  const [modalIsOpen, setModalIsOpen] = useState(false);
  const [currentUser, setCurrentUser] = useState(null);

  useEffect(() => {
    const fetchVilla = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/api/villa/${id}`);
        setVilla(response.data);
        setSpaces(response.data.spaces || []);
      } catch (error) {
        console.error('Error fetching villa details:', error);
      }
    };

    const fetchCurrentUser = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/user/current', { withCredentials: true });
        setCurrentUser(response.data);
        console.log('Current user:', response.data);
      } catch (error) {
        console.error('Error fetching current user:', error);
      }
    };

    fetchVilla();
    fetchCurrentUser();
  }, [id]);

  const openModal = async (space) => {
    if (space.type !== 'PARKING') return;
    setSelectedSpace(space);
    if (space.isOccupied && space.username) {
      try {
        const userResponse = await axios.get(`http://localhost:3001/api/user/${space.username}`, { withCredentials: true });
        setSelectedSpace({ ...space, ...userResponse.data });
      } catch (error) {
        console.error('Error fetching user details:', error);
      }
    }
    setModalIsOpen(true);
  };

  const closeModal = () => {
    setModalIsOpen(false);
    setSelectedSpace(null);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setSelectedSpace((prevSpace) => ({ ...prevSpace, [name]: value }));
  };

  const handleSubmit = async () => {
    if (!currentUser) {
      console.error('No current user found');
      return;
    }

    try {
      const response = await axios.post(`http://localhost:3001/api/villa/${id}/update-space/${selectedSpace._id}`, {
        ...selectedSpace,
        isOccupied: true,
        username: currentUser.username,
        vehicleName: currentUser.vehicleName,
        vehicleNumber: currentUser.vehicleNumber,
        contact: currentUser.phone
      });
      console.log('Updated space data:', response.data);
      setSpaces((prevSpaces) =>
        prevSpaces.map((space) =>
          space._id === selectedSpace._id
            ? { ...space, ...selectedSpace, isOccupied: true, username: currentUser.username, vehicleName: currentUser.vehicleName, vehicleNumber: currentUser.vehicleNumber, contact: currentUser.phone }
            : space
        )
      );
      closeModal();
    } catch (error) {
      console.error('Error updating parking space:', error);
    }
  };

  const handleExit = async () => {
    try {
      await axios.post(`http://localhost:3001/api/villa/${id}/update-space/${selectedSpace._id}`, {
        ...selectedSpace,
        isOccupied: false,
        username: null,
        vehicleName: null,
        vehicleNumber: null,
        contact: null,
        exitTime: null,
        notes: null
      });
      setSpaces((prevSpaces) =>
        prevSpaces.map((space) =>
          space._id === selectedSpace._id
            ? { ...space, isOccupied: false, username: null, vehicleName: null, vehicleNumber: null, contact: null, exitTime: null, notes: null }
            : space
        )
      );
      closeModal();
    } catch (error) {
      console.error('Error updating parking space:', error);
    }
  };

  if (!villa) return <div>Loading...</div>;

  const handleGoToMain = () => {
    navigate('/main');
  };

  return (
    <div>
      <h2>{villa.villaName}</h2>
      <div className="spaces">
        {spaces.map((space) => (
          <div
            key={space._id}
            className={`space ${space.type.toLowerCase()}`}
            style={{
              left: `${space.left}px`,
              top: `${space.top}px`,
              width: `${space.width}px`,
              height: `${space.height}px`,
              backgroundColor: space.isOccupied ? 'red' : 'green'
            }}
            onClick={() => openModal(space)}
          >
            {space.type}
          </div>
        ))}
      </div>
      <Modal isOpen={modalIsOpen} onRequestClose={closeModal} contentLabel="Parking Space Details">
        {selectedSpace && (
          <div>
            <h2>{selectedSpace.isOccupied ? '주차 중' : '주차 하기'}</h2>
            <div>
              {selectedSpace.isOccupied && (
                <>
                  <p>차종: {selectedSpace.vehicleName}</p>
                  <p>차번호: {selectedSpace.vehicleNumber}</p>
                  <p>연락처: {selectedSpace.contact}</p>
                </>
              )}
              {!selectedSpace.isOccupied && (
                <>
                  <label>
                    출차시간:
                    <input type="text" name="exitTime" value={selectedSpace.exitTime || ''} onChange={handleInputChange} />
                  </label>
                  <label>
                    특이사항:
                    <input type="text" name="notes" value={selectedSpace.notes || ''} onChange={handleInputChange} />
                  </label>
                </>
              )}
            </div>
            <button onClick={selectedSpace.isOccupied ? handleExit : handleSubmit}>
              {selectedSpace.isOccupied ? '출차 하기' : '주차 하기'}
            </button>
            <button onClick={closeModal}>닫기</button>
          </div>
        )}
      </Modal>
      <button onClick={handleGoToMain}>메인 페이지로</button>
    </div>
  );
};

export default VillaDetail;
